    {
      id: 2,
      name: "Product 2",
      price: "200 INR",
      description: "This is a detailed description of Product 2.",
      terms: "Terms and conditions for Product 2.",
      image: "https://via.placeholder.com/150?text=Product+2",
    },
    // Add more products
    {
      id: 24,
      name: "Product 24",
      price: "2400 INR",
      description: "This is a detailed description of Product 24.",
